00503     void                                  FillList                                      (XAVLNODE<K>* n, const K& key, XLIST<K>* list)
00504                                           {
00505                                             // finds all ocurrences of nodes in the tree taking advantage of rotations being invariant
00506                                             if(n == NULL)
00507                                               {
00508                                                 return;
00509                                               }
00510 
00511                                             // in order visit
00512                                             // visit left
00513                                             FillList(n->left, key, list);
00514 
00515                                             // visit me
00516                                             //if I'm bigger return and don't continue
00517                                             if(islessimp(key, n->key))
00518                                               {
00519                                                 return;
00520                                               }
00521                                             else if(!islessimp(n->key, key))
00522                                               {
00523                                                 // neither bigger or smaller, must be equal
00524                                                 list->Add(n->key);
00525                                               }
00526 
